import React from "react";
import { Button } from '../ButtonElement';
import {
  InfoContainer,
  InfoWrapper,
  Column1,
  Column2,
  ImgWrap,
  Img,
  InfoRow,
  TextWrapper,
  TopLine,
  Heading,
  SubTitle,
  BtnWrap,
} from './InfoElement.js';

const InfoSection = ({lightBg,id,darkText,description,imgStart,topLine,lightText,headline,buttonLabel,img,alt}) => {
  return (
    <div>
      <InfoContainer lightBg={lightBg} id={id}>
        <InfoWrapper>
          <InfoRow imgStart={imgStart}>
            <Column1>
              <TextWrapper>
                <TopLine>{topLine}</TopLine>
                <Heading lightText={lightText}>{headline}</Heading>
                <SubTitle darkText={darkText}>{description}</SubTitle>
                <BtnWrap>
                  <Button to="home"
                    smooth={true}
                    duration={500}
                    spy={true}
                  >{buttonLabel}</Button>
                </BtnWrap>
              </TextWrapper>
            </Column1>
            <Column2>
              <ImgWrap>
                <Img src={img} alt={alt} />
              </ImgWrap>
            </Column2>
          </InfoRow>
        </InfoWrapper>
      </InfoContainer>
    </div>
  );
};

export default InfoSection;
